rect dynamic feed URL.'=>'%1$sDeze URL verwijst naar een bestand in je Mediabibliotheek.%2$s Hoewel je deze URL zou moeten kunnen gebruiken in een %3$s shortcode, zal het een statische momentopname zijn van de kalender op het moment dat het bestand werd gemaakt en zal het geen toekomstige updates van de bronkalender weergeven. Raadpleeg onze %4$sGebruikershandleiding%5$s voor instructies over het verkrijgen van de juiste dynamische feed URL.','Error: Could not resolve IP address for %1$s.'=>'Fout: Kan IP-adres voor %1$s niet oplossen.','Resolved IP address for %1$s:'=>'Opgelost IP-adres voor %1$s:','The text entered in the "Default shortcode" field is not a valid shortcode, and was not saved.'=>'De tekst die is ingevoerd in het veld "Standaard shortcode" is geen geldige shortcode en is niet opgeslagen.','%1$sSettings updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sInstellingen bijgewerkt.%2$s Mogelijk moet u de pagina vernieuwen om enkele wijzigingen te zien.','calendar event'=>'kalender evenement','The legacy feed request method is deprecated, and will be removed in an update in the near future. Please test your feeds with the legacy feed request method turned off.'=>'De oude feedverzoekmethode is verouderd en zal in de nabije toekomst in een update worden verwijderd. Test je feeds met de oude feedverzoekmethode uitgeschakeld.','Map'=>'Kaart','Recurring event'=>'Terugkerende evenement','Recurs every %1$s years'=>'Komt elke %1$s jaar terug','Recurs yearly'=>'Herhaalt zich jaarlijks','Recurs every %1$s months'=>'Komt elke %1$s maanden terug','Recurs monthly'=>'Herhaalt zich maandelijks','Recurs every %1$s weeks'=>'Komt elke %1$s weken terug','Recurs weekly'=>'Herhaalt zich wekelijks','Recurs every %1$s days'=>'Komt elke %1$s dagen terug','Recurs daily'=>'Herhaalt zich dagelijks','The "url" property in your %1$s shortcode appears to contain HTML tags; most likely your URL has been turned into a clickable link. Your calendar may not display properly as a result. Please remove the clickable link in the shortcode.'=>'De eigenschap "url" in uw %1$s shortcode lijkt HTML-tags te bevatten; waarschijnlijk is uw URL veranderd in een klikbare link. Uw agenda wordt daardoor mogelijk niet goed weergegeven. Verwijder de klikbare link in de shortcode.','The r34ics_url_get_contents() function is no longer supported.'=>'De functie r34ics_url_get_contents() wordt niet langer ondersteund.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sLet op:%2$s %3$s versie 10.6 wijzigt de standaardopties voor verschillende shortcode-instellingen. Om de consistentie te behouden, zijn deze nieuwe standaardinstellingen %4$sniet%5$s ingeschakeld bij een upgrade vanaf een eerdere versie. Als u meer wilt weten over de wijzigingen, lees dan onze %6$sblog post%7$s, of schakel de %8$s optie in op de %9$s instellingen%10$s pagina om over te schakelen naar de nieuwe standaardinstellingen.','Use new parameter defaults (v.10.6)'=>'Nieuwe standaardparameters gebruiken (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sLet op:%2$s %3$s versie 11.0 stroomlijnt de manier waarop ICS feed URL\'s worden opgehaald. Deze wijziging maakt gebruik van een standaard ingebouwde WordPress-functie, dus het zou volledig compatibel moeten zijn met alle bestaande installaties. Als je nieuwe problemen tegenkomt na het upgraden naar versie 11 of hoger, ga dan naar de %4$sWordPress Support Forums%5$s voor hulp.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sLet op:%2$s %3$s versie 11.5.14.2 introduceert een nieuwe, veiligere methode voor het afhandelen van kalenderparameters bij het laden via AJAX. Verwijder caching-plugins die je gebruikt om ervoor te zorgen dat je kalenders goed worden geladen met de nieuwe methode.','Add %1$s'=>'Voeg %1$s toe','Close'=>'Sluiten','ICS Feed URL:'=>'ICS Feed URL:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Zorg ervoor dat u een %1$ssubscribe%2$s URL gebruikt, niet een %3$sweb view%4$s URL.%5$s (Als u de URL rechtstreeks in uw webbrowser invoert, moet u een %6$s bestand downloaden)','Calendar Title:'=>'Kalendertitel:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Laat leeg om de standaardtitel van de agenda te gebruiken. Voer %1$s in om de titel helemaal weg te laten.','Calendar Description:'=>'Kalender beschrijving:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Laat leeg om de standaard beschrijving van de kalender te gebruiken. Vul %1$s in om de beschrijving helemaal weg te laten.','View:'=>'Toon:','month'=>'maand','list'=>'lijst','week'=>'week','Count:'=>'Telling:','Format:'=>'Formaat:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Laat %1$s leeg om alle komende evenementen op te nemen. %2$s moet een standaard %3$sPHP datum formaat string%4$s zijn.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Toon evenementbeschrijvingen %1$s(verander in een getal in ingevoegde shortcode om woordlimiet in te stellen)%2$s','Show event locations %1$s(if available)%2$s'=>'Toon evenementenlocaties %1$s(indien beschikbaar)%2$s','Show event organizers %1$s(if available)%2$s'=>'Toon organisatoren van evenementen %1$s(indien beschikbaar)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sOpmerking:%2$s Extra %3$sweergaveopties%4$s zijn beschikbaar door de shortcode na het invoegen handmatig te bewerken.','Insert %1$s'=>'Insert %1$s','Do even more with %1$s!'=>'Doe nog meer met %1$s!','Calendar Builder'=>'Kalender Bouwer','Configure all calendar settings with an easy visual interface... no need to manually type shortcodes.'=>'Configureer alle kalenderinstellingen met een eenvoudige visuele interface... handmatig shortcodes typen is niet nodig.','Additional Views and Enhanced Features'=>'Extra weergaven en verbeterde functies','New ways to display your calendar including Full, Up Next, Masonry, Month with Sidebar, Widget, and more. Additional capabilities are added to the core Month, Basic, List and Week views.'=>'Nieuwe manieren om je kalender weer te geven, waaronder Volledig, Volgende, Masonry, Maand met zijbalk, Widget en meer. Er zijn extra mogelijkheden toegevoegd aan de basisweergaven Maand, Basis, Lijst en Week.','Customizer'=>'Customizer','Easily modify your calendar color palettes, fonts, and more, site-wide.'=>'Pas eenvoudig de kleurpaletten, lettertypen en nog veel meer van je kalender aan op de hele site.','ICS Events'=>'ICS Evenementen','%1$sNew!%2$s Turns %3$s into a full calendar system. Create and manage events directly in WordPress and even integrate them seamlessly with your existing feeds.'=>'%1$sNieuw!%2$s Maakt van %3$s een volledig agendasysteem. Maak en beheer evenementen rechtstreeks in WordPress en integreer ze zelfs naadloos met je bestaande feeds.','Visit %1$s to learn more.'=>'Bezoek %1$s voor meer informatie.','Go PRO!'=>'Ga PRO!','Getting Started'=>'Aan de slag','System Report'=>'Systeemrapport','Save Changes'=>'Wijzigingen opslaan','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Bedankt voor de installatie van %1$s. Voordat u uw eerste kalender shortcode maakt, bezoek uw %2$sAlgemene Instellingen%3$s pagina en controleer of de taal, tijdzone en datum/tijd formaat instellingen van uw site correct zijn. Zie onze %4$sGebruikershandleiding%5$s voor meer informatie.','Quick Start Guide'=>'Snel Start Handleiding','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Een uitgebreide %1$sGebruikershandleiding%2$s is beschikbaar op onze website. Hieronder vindt u enkele snelle links naar belangrijke bronnen in de documentatie.','General:'=>'Algemeen:','General WordPress Settings'=>'Algemene WordPress Instellingen','%1$s Settings'=>'%1$s-instellingen','Working with Shortcodes:'=>'Werken met shortcodes:','Shortcode Overview'=>'Overzicht shortcodes','Shortcode Builder'=>'Shortcode Bouwer','Shortcode Parameters Reference'=>'Referentie Shortcode Parameters','Advanced Topics:'=>'Onderwerpen voor gevorderden:','FAQs and Tips'=>'Veelgestelde vragen en tips','CSS Guide'=>'CSS Handleiding','Developer Resources'=>'Bronnen voor ontwikkelaars','GDPR'=>'AVG','Appearance'=>'Uiterlijk','Match calendar color palette to current Block Theme colors'=>'Kalender kleurenpalet afstemmen op huidige blokthema kleuren','beta'=>'beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Vervangt het %1$s standaard neutrale kleurenpalet door de dichtstbijzijnde overeenkomsten uit het huidige Site Editor Styles kleurenpalet of het %2$s bestand in uw thema. Kleurselecties zijn algoritmisch en sommige combinaties komen mogelijk niet door de toegankelijkheidscontrasttest. Deze instelling heeft geen effect als u een "klassiek" thema gebruikt dat geen %3$s bestand bevat.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar settings or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sDit is momenteel een bètafunctie.%2$s Het kan nodig zijn om je agenda-instellingen of CSS aan te passen voor een optimale weergave, vooral als je je feeds een kleurcode hebt gegeven. De functionaliteit kan worden gewijzigd.','Dark mode'=>'Donkere modus','Inverts color palette (light colors on a dark background). %1$sNote:%2$s Dark mode also automatically applies style changes similar to the %3$s and %4$s shortcode parameters, so you do not need to include them in your shortcode.'=>'Inverteert kleurenpalet (lichte kleuren op een donkere achtergrond). %1$sOpmerking:%2$s De donkere modus past ook automatisch stijlwijzigingen toe die vergelijkbaar zijn met de %3$s en %4$s shortcodeparameters, dus je hoeft deze niet in je shortcode op te nemen.','Loading'=>'Laden','Always use AJAX to render calendars (recommended)'=>'Gebruik altijd AJAX om kalenders weer te geven (aanbevolen)','When checked, all calendars will render via AJAX (asynchronously after the page loads). This is especially useful in conjunction with other caching plugins, or if your calendars contain a large number of events. Normally, calendar data is sent directly in the HTML of the initial page load unless AJAX has been specified in the shortcode.'=>'Als deze optie is aangevinkt, worden alle kalenders via AJAX gerenderd (asynchroon nadat de pagina is geladen). Dit is vooral handig in combinatie met andere cachingplugins of als je kalenders een groot aantal gebeurtenissen bevatten. Normaal gesproken worden kalendergegevens direct in de HTML van de eerste paginalading verzonden, tenzij AJAX is gespecificeerd in de shortcode.','Increase memory limit when rendering calendars'=>'Verhoog geheugenlimiet bij het renderen van kalenders','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Als je agenda niet wordt geladen met een fatale foutmelding "out of memory", probeer dan de geheugenlimiet te verhogen. Een minimum van 512 MB wordt aanbevolen. %1$s Opmerkingen: 1) Sommige hostingproviders staan niet toe dat applicaties de standaardinstelling van de server overschrijven. 2) Het is niet mogelijk om deze optie lager in te stellen dan de huidige standaardgeheugenlimiet op uw server.','deprecated'=>'verouderd','If your site has stopped retrieving feeds after the version 11 update, turn on this option to use the legacy request method. This feature is deprecated and will be removed in an update in the near future.'=>'Als je site is gestopt met het ophalen van feeds na de update van versie 11, schakel dan deze optie in om de oude aanvraagmethode te gebruiken. Deze functie is verouderd en zal in een update in de nabije toekomst worden verwijderd.','Default shortcode'=>'Standaard shortcode','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Als uw site een groot aantal gelijk geconfigureerde kalender-snelcodes bevat, kunt u hier een standaard "basis"-kortcode invoeren met de parameters die voor alle kalenders hetzelfde moeten zijn. Individuele shortcodes op de site kunnen dan alleen de parameters bevatten die uniek zijn voor die kalender: %1$s Alle parameters die in de individuele shortcode zijn opgenomen, overschrijven wat hier is ingesteld.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Toegang toestaan tot deze hostnamen die resolven naar gereserveerde IP-adressen','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Als je kalenderserver op dezelfde fysieke server wordt gehost als je website, deel uitmaakt van hetzelfde lokale netwerk of anderszins een %1$sgereserveerd IP-adres%2$s gebruikt, voer dan hier de hostnaam in om toegang mogelijk te maken. Voer voor meerdere kalenderservers één hostnaam per regel in. Zie %3$sde %4$s documentatie%5$s voor meer informatie.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Voer één hostnaam per regel in. Hostnamen zijn de basisdomeinnaam, geen volledige URL. %1$s Je zou bijvoorbeeld %2$s invoeren, niet %3$s.','Caching'=>'Caching','Transient (cache) expiration'=>'Voorbijgaande (cache) expiratie','seconds'=>'seconden','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour).'=>'Stelt in hoe lang kalenderfeed gegevens moeten worden gecached op de server (WordPress transients) voordat ze opnieuw worden geladen. Standaard is 3600 (1 uur).','Miscellaneous'=>'Diversen','Remove "Add ICS Calendar" button in Classic Editor'=>'Knop "ICS-kalender toevoegen" in klassieke editor verwijderen','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Standaard voegt ICS Calendar een knop "Add ICS Calendar" toe aan de werkbalk boven de WYSIWYG-editor als je de Classic Editor gebruikt. Vink dit vakje aan om de knop te verwijderen. Heeft geen effect op sites die de Block Editor (Gutenberg) gebruiken.','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s versie 10.6 introduceerde nieuwe standaardwaarden voor verschillende shortcode-parameters. Nieuwe installaties gebruiken automatisch de nieuwe standaardwaarden, maar opgewaardeerde installaties blijven de oude standaardwaarden gebruiken, tenzij dit vakje is aangevinkt. Lees meer over deze wijzigingen op %2$sonze blog%3$s.','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Onze volledige gebruikershandleiding is beschikbaar met volledige vertaling in tientallen talen op onze website:','For assistance, please use our %1$ssupport request form%2$s.'=>'Gebruik voor hulp ons %1$sondersteuningsaanvraagformulier%2$s.','When contacting support, please include the %1$sSystem Report%2$s from this page.'=>'Wanneer u contact opneemt met ondersteuning, vermeld dan het %1$sSysteemrapport%2$s van deze pagina.','Spread the word!'=>'Zeg het voort!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Als je %1$s nuttig vindt, kun je helpen onze voortdurende groei en ontwikkeling te ondersteunen met een %2$svijfsterrenbeoordeling%3$s. Hartelijk dank!','%1$s Data Cache'=>'%1$s Data Cache','Clear Cached Calendar Data'=>'Kalendergegevens in cache wissen','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Dit zal onmiddellijk alle bestaande kalendergegevens in de cache wissen, waardoor WordPress wordt gedwongen om alle kalenders opnieuw te laden de volgende keer dat ze worden bekeken. Caching wordt dan hervat zoals voorheen.','ICS Feed URL Tester'=>'URL-tester van ICS-feed','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Als je je zorgen maakt dat de plugin je feed niet goed ophaalt, kun je de URL hier testen.','Enter feed URL...'=>'Voer de feed-URL in...','Test URL'=>'Test URL','Results:'=>'Resultaten:','%1$s received.'=>'%1$s ontvangen.','This appears to be a valid ICS feed URL.'=>'Dit lijkt een geldige ICS-feed URL te zijn.','This does not appear to be a valid ICS feed URL.'=>'Dit lijkt geen geldige ICS feed URL te zijn.','Could not retrieve data from the requested URL.'=>'Kan geen gegevens ophalen van de gevraagde URL.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Er is een onbekende fout opgetreden tijdens het ophalen van de gevraagde URL.','Please copy the following text and include it in your message when emailing support.'=>'Kopieer de volgende tekst en neem deze op in uw bericht wanneer u naar de ondersteuning e-mailt.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Vermeld ook de %1$s shortcode precies zoals u die op de betreffende pagina hebt ingevoerd.','For your site security please do NOT post the System Report in the support forums.'=>'Plaats voor de veiligheid van uw site het systeemrapport NIET in de ondersteuningsforums.','No events found.'=>'Geen evenementen gevonden.','Previous Page'=>'Vorige pagina','Next Page'=>'Volgende pagina','All Day'=>'Hele dag','Today'=>'Vandaag','No events.'=>'Geen evenementen.','No additional events this month.'=>'Geen extra evenementen deze maand.','Last week'=>'Afgelopen week','This week'=>'Deze week','Next week'=>'Volgende week','ICS Calendar'=>'ICS Calendar','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Maak van je Google Agenda, Microsoft Office 365 of Apple iCloud Agenda een naadloos geïntegreerde, automatisch bijgewerkte en onderhoudsvrije WordPress-ervaring.','Room 34 Creative Services, LLC'=>'Room 34 Creative Services, LLC']];
